const UserForm = () => {
    return (
        <form onSubmit={submit}>
        <Input 
          label='Name'
          name='name'
          value={form.name}
          onChange={handleChange}
          placeholder='Name'
        />
        <Input 
          label='Last Name'
          name='lastName'
          value={form.lastName}
          onChange={handleChange}
          placeholder='Last Name'
        />
        <Input 
          label='Email'
          name='email'
          value={form.email}
          onChange={handleChange}
          placeholder='Email'
        />
        <Button>Send</Button>
      </form>
    );
};

export default UserForm;
